%This program is the implementation of the "official" recipe by Jon Yngve Hardeberg
%to choose an optimal reduced subset of calibration patches from a target.
%First, the patch with highest norm, i.e. highes transmission is chosen.
%Then another patch with minimum condition number with respect to the first
%patch is chosen. In this way, the second patch is as different as possible
%from the first patch. As a result, the most linearly independent vector
%space is spanned, which gives the best fit.
%Patches with low L and patches with no 20,21,22 have been removed
%beforehand. Problem is that the spectral data for the IT8.7 target are not available.
%Spectral data from a similar target were chosen.
%The resulting choice looks meaningful, but surprisingly the method does not work as good as the heuristic subset,
%chosen to optimally span the XYZ space.


